INSERT INTO `mangas` (`id_manga`, `titulo`, `link`, `tipo`, `status`, `sinopse`, `autor`, `artista`, `ano_lancado`, `capa`) VALUES
(47, 'Warrior High School – Dungeon Raid Department', 'warrior-high-school--dungeon-raid-department', 'Manhwa', 'Ongoing', 'Num mundo onde os calabouços surgem misteriosamente, a humanidade precisa de caçadores para proteger a paz. No Warrior High School, os alunos treinam para se tornarem caçadores de elite. Entre eles, surge um jovem com um passado misterioso e um talento extraordinário para o combate. Quando monstros atacam, o Departamento de Dungeon Raid é a primeira linha de defesa, e a sobrevivência da humanidade depende do trabalho desta equipa.', 'Park Minse', 'Jo Hyunhwan', 2022, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1748978555/capas/phpE22A.jpg'),
(48, 'Return of the Mount Hua Sect', 'return-of-the-mount-hua-sect', 'Manhwa', 'Ongoing', 'Após a sua morte numa batalha sangrenta, Chung Myung, o lendário Espadachim da Flor de Ameixa, renasce no corpo de um órfão num mundo 100 anos depois. Descobre que a sua seita, a gloriosa Seita Mount Hua, outrora uma das mais poderosas, está agora em decadência e esquecida. Com sede de justiça e desejo de restaurar a glória da sua seita, Chung Myung embarca numa jornada para reerguer a Seita Mount Hua das cinzas, enfrentando inimigos poderosos e desafiando o destino.', 'Biga', 'LICO', 2021, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1748978640/capas/php3930.jpg'),
(49, 'Solo Leveling', 'solo-leveling', 'Manhwa', 'Finalizado', 'Num mundo onde portais misteriosos ligam a Terra a dimensões repletas de monstros, apenas caçadores com habilidades especiais conseguem entrar e lutar.\r\nSung Jin-Woo, conhecido como o \"Caçador Mais Fraco do Mundo\", luta para sobreviver como um E-rank. No entanto, tudo muda quando ele enfrenta uma dungeon secreta e recebe uma oportunidade única: tornar-se um Jogador com a habilidade de \"subir de nível\" — algo que ninguém mais consegue fazer.\r\nCom o seu novo poder, Sung Jin-Woo começa a desafiar monstros, chefes e até outros caçadores, evoluindo de um fraco a uma lenda inigualável.', 'Chugong', 'Jang Sung-rak', 2018, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1748978709/capas/php4419.jpg'),
(50, 'Solo Max-Level Newbie', 'solo-max-level-newbie', 'Manhwa', 'Ongoing', 'Jinhyuk é um streamer conhecido por jogar o jogo Tower of Trials, mas quando o jogo perde popularidade e ele se prepara para encerrar a carreira... a torre misteriosamente aparece no mundo real.\r\nO que para muitos é um apocalipse, para Jinhyuk é uma oportunidade: ele é o único jogador que conhece os segredos e estratégias de cada andar, cada boss e cada puzzle, pois foi o único a terminar o jogo no nível máximo.\r\nCom o seu conhecimento avançado e inteligência estratégica, Jinhyuk sobe a torre enquanto outros tentam apenas sobreviver — e rapidamente deixa de ser apenas um streamer para se tornar uma lenda.', 'Jang Sung-Lak', 'Swing Bat, Redice Studio', 2021, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1748978875/capas/phpC7C7.png'),
(51, 'Martial God Regressed to Level 2', 'martial-god-regressed-to-level-2', 'Manhwa', 'Ongoing', 'O lendário Deus Marcial salvou o mundo da destruição ao derrotar a ameaça final. No entanto, após a vitória, percebe que tudo o que resta é solidão... até que algo inesperado acontece: ele regressa misteriosamente no tempo ao seu nível 2, quando ainda era um guerreiro iniciante.\r\nAgora, com todo o conhecimento e habilidades da sua vida passada, ele tem uma nova chance para corrigir erros, proteger os que ama e subir novamente ao topo — mas desta vez, de forma ainda mais brutal e eficiente.\r\nUma segunda oportunidade para dominar tudo... desde o início!', 'Yeombi', 'Ah Yoongu', 2022, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749328056/capas/phpBC1E.jpg'),
(52, 'Superhuman Battlefield', 'superhuman-battlefield', 'Manhwa', 'Ongoing', 'O mundo foi abalado por uma guerra onde super-humanos enfrentaram monstros vindos de outras dimensões. Entre eles, Seo MoonYeop, o herói lendário, foi o responsável por salvar a humanidade.\r\nMas, após o fim da guerra, Seo MoonYeop foi injustamente esquecido e tornou-se apenas mais um rosto anónimo na multidão. Agora, com o ressurgimento das batalhas e o perigo a aumentar, ele decide regressar à arena para mostrar novamente o seu poder e provar que é, de facto, o herói mais forte do mundo.\r\nPreparem-se para uma história épica onde o combate entre super-humanos e monstros define o destino da Terra!', 'Niccolo', 'Plan A', 2022, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749418260/capas/php5F07.png'),
(53, 'Terminally-Ill Genius Dark Knight', 'terminally-ill-genius-dark-knight', 'Manhwa', 'Ongoing', 'O protagonista é diagnosticado com uma doença terminal e tem apenas seis meses de vida. Mas, antes de morrer, ele é transportado para um jogo de realidade virtual onde assume o papel de um Cavaleiro Negro, uma das classes mais poderosas e temidas.\r\nAgora, com o tempo contado tanto na vida real como no jogo, ele decide viver sem arrependimentos, desafiando chefes, monstros e até o próprio sistema do jogo, usando a sua inteligência superior para contornar obstáculos impossíveis.\r\nCom o poder do Dark Knight e a sua mente genial, ele pretende mudar o destino, custe o que custar!', 'Jung Seon Yul', 'Nagi', 2023, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749457163/capas/php22D3.jpg'),
(54, 'Versatile Mage', 'versatile-mage', 'Manhua', 'Finalizado', 'Mo Fan é um estudante comum, até que um dia, misteriosamente, o mundo à sua volta muda. Na nova realidade, a magia substituiu a ciência, e os magos são a elite da sociedade. Apesar de vir de uma família pobre, Mo Fan descobre que possui um talento raro: consegue controlar vários elementos mágicos, ao contrário dos outros magos que só conseguem controlar um!\r\nAgora, com a ajuda dos seus amigos, incluindo Mu Ningxue (magia de gelo) e Xu Zhaoting (magia de relâmpago), Mo Fan enfrenta monstros, inimigos poderosos e tenta sobreviver num mundo repleto de perigos mágicos, tudo enquanto luta para proteger a sua família e os seus amigos.', 'Luan ', 'Domingo', 2016, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749457277/capas/phpEFF2.jpg'),
(55, 'Nano Machine', 'nano-machine', 'Manhwa', 'Ongoing', 'Cheon Yeo-Woon, um bastardo esquecido da Ordem Demoníaca, vive uma vida marcada por traições e desprezo. Mas tudo muda quando um misterioso descendente do futuro aparece e lhe injeta uma nanomáquina avançada.\r\nCom esta tecnologia que aumenta drasticamente as suas habilidades físicas, mentais e de combate, Yeo-Woon começa a trilhar o caminho rumo ao trono da seita demoníaca — enfrentando clãs, rivais, mestres de artes marciais e inimigos políticos, enquanto evolui mais rápido do que qualquer cultivador da sua era.\r\nEle deixará de ser um peão para se tornar o rei de todos.', 'Hanjoong Wolya', 'Indestructible', 2020, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749457711/capas/php84E3.jpg'),
(56, 'I Am the Fated Villain', 'i-am-the-fated-villain', 'Manhua', 'Ongoing', 'Gu Changge renasce num mundo de cultivo... mas como o vilão principal de uma novel! Dotado de um sistema que o guia a encarnar perfeitamente o papel de vilão, ele começa a manipular heróis e protagonistas, destruindo os seus caminhos com astúcia, charme e poder absoluto.\r\nEnquanto os outros acreditam que são os escolhidos do destino, Gu Changge move-se nas sombras, controlando os eventos e moldando o mundo à sua vontade — tudo enquanto mantém a fachada de um nobre cultivador.\r\nMas o que acontece quando o vilão deixa de seguir o guião e começa a reescrever a história?', 'Fǎn Pài Bùdà ', 'Yesman', 2021, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749457852/capas/phpB12A.jpg'),
(57, 'Absolute Necromancer', 'absolute-necromancer', 'Manhwa', 'Ongoing', 'Hansoo Kang foi traído e assassinado por aqueles em quem mais confiava. Mas a morte não foi o fim — foi apenas o início.\r\nRenascido com o poder do necromante mais poderoso e com um sistema especial que o torna único, Hansoo regressa ao mundo com um único objetivo: vingança absoluta.\r\nCom a capacidade de reviver os mortos, controlar exércitos de esqueletos e evoluir para formas mais poderosas, ele enfrenta inimigos antigos e novos, sempre um passo à frente.\r\nNeste novo mundo, ele não será mais a vítima… será o predador supremo.', 'Chung Song', 'Ji Baekho', 2023, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749458474/capas/php26BD.jpg'),
(58, 'The Heavenly Demon Can’t Live a Normal Life', 'the-heavenly-demon-cant-live-a-normal-life', 'Manhwa', 'Ongoing', 'Baek Joong-Hyuk, conhecido como o invencível Heavenly Demon, era o governante absoluto do Culto Celestial. Após uma traição mortal, ele desperta... no corpo de Roman Dmitri, o filho inútil de uma família nobre num mundo de espadas e magia.\r\nDeterminando-se a não repetir os erros do passado, o antigo demónio agora precisa de adaptar as suas técnicas marciais a uma nova sociedade, lidar com guerras políticas e elevar o nome Dmitri à grandeza — tudo enquanto lida com pessoas que ainda o veem como um fracassado.\r\n\r\nMas o mundo aprenderá rapidamente: não se deve subestimar um demónio reencarnado.', 'San Cheon', 'Hyeon Dong', 2021, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749458651/capas/phpE07F.png'),
(59, 'Mercenary Enrollment', 'mercenary-enrollment', 'Manhwa', 'Hiatus', 'Yu Ijin, o único sobrevivente de um acidente de avião, viveu durante 10 anos como um mercenário de elite numa zona de guerra. Um dia, ele recebe a oportunidade de voltar à Coreia do Sul e reencontrar a sua família.\r\nMas a vida escolar comum não é tão pacífica quanto parece. A violência, bullying e ameaças àqueles que ama forçam Ijin a usar as suas habilidades letais para proteger os seus entes queridos.\r\nMesmo longe do campo de batalha, um guerreiro nunca baixa a guarda.', 'YC', 'Rak Hyun', 2020, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749458770/capas/phpB494.jpg'),
(60, 'Academy\'s Genius Swordmaster', 'academys-genius-swordmaster', 'Manhwa', 'Ongoing', 'Ronan, um guerreiro brutal e impiedoso do passado, conhecido por massacres em nome da guerra, reencarna inesperadamente... no corpo de um jovem aluno de uma academia de magia.\r\nNesta nova vida, ele vê a oportunidade de não apenas evitar os erros do passado, mas também de dominar o mundo da magia com a sua experiência em esgrima e batalha real.\r\nCombinando os seus instintos sanguinários e conhecimento de campo com o treino académico, Ronan rapidamente se destaca como o espadachim mais temido e promissor da academia.\r\n\r\nMas antigos inimigos e novas conspirações não o deixarão em paz...', 'Seo Kwan-Do', 'Shichi', 2023, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749458919/capas/phpF6A6.jpg'),
(61, 'Second Life Ranker', 'second-life-ranker', 'Manhwa', 'Ongoing', 'Yeon-woo perde o seu irmão gémeo de forma misteriosa. Ao investigar, descobre que ele morreu enquanto participava numa misteriosa torre dimensional chamada Obelisco, onde os jogadores competem por poder.\r\nQuando Yeon-woo encontra o diário do irmão, ele decide entrar na torre — não apenas para descobrir a verdade, mas para terminar o que o seu irmão começou.\r\nMunido do conhecimento do diário e de uma sede de vingança, Yeon-woo começa a escalar a torre com um único objetivo: chegar ao topo como o Ranker mais poderoso.', 'Sa Do-Yeon', 'REDICE Studio / Dreamtoon', 2019, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749459131/capas/php34AB.jpg'),
(62, 'Revenge of the Iron-Blooded Sword Hound', 'revenge-of-the-iron-blooded-sword-hound', 'Manhwa', 'Ongoing', 'Vikir Van Baskerville era o mais leal guerreiro do seu clã... até que foi traído e executado injustamente por aqueles que jurou proteger. Mas a morte não foi o fim — ele regressa ao passado, antes de tudo acontecer.\r\nCom as memórias de uma vida passada cheia de sofrimento e um desejo inabalável de vingança, Vikir decide mudar o seu destino.\r\nDesta vez, ele irá esmagar todos os que o traíram com a sua espada e construir o seu próprio caminho, reescrevendo a história de sangue com sangue.', 'I Stepped On Lego', 'Ahrang', 2023, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749459324/capas/php200C.jpg'),
(63, 'I Obtained a Mythic Item', 'i-obtained-a-mythic-item', 'Manhwa', 'Ongoing', 'Num mundo onde portais se abrem e monstros invadem a Terra, apenas os Despertares podem enfrentá-los com poderes únicos.\r\nJaehyeon, um caçador de baixo nível, luta para sobreviver com os seus poucos recursos. Tudo muda quando ele obtém um Item Mítico — um artefacto lendário com poderes além da imaginação.\r\nCom esse item, Jaehyeon começa a ultrapassar os limites da humanidade, subir no ranking dos caçadores e enfrentar forças que desejam o artefacto a qualquer custo.\r\nUma nova lenda está prestes a nascer — e ele não tem intenção de parar até chegar ao topo.', 'Jeong Sunyool', 'Heth', 2022, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749459494/capas/phpB61A.jpg'),
(64, 'Return of the SSS-Class Ranker', 'return-of-the-sss-class-ranker', 'Manhwa', 'Ongoing', 'Rokan, o mais poderoso SSS-Class Berserker do jogo Lord, foi traído e apagado pelos seus próprios aliados no auge da sua glória.\r\nMas o destino dá-lhe uma segunda oportunidade: ele acorda no passado, antes de tudo acontecer, e com as memórias completas da sua vida anterior.\r\nDesta vez, Rokan promete subir novamente ao topo — mais rápido, mais forte e mais impiedoso do que nunca.\r\nCom sede de vingança e uma vantagem absoluta no jogo, ele não deixará pedra sobre pedra até destruir aqueles que o traíram e dominar completamente o mundo de Lord.', 'Gald', 'Hojo', 2021, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749459747/capas/php988D.jpg'),
(65, 'The Dark Magician Transmigrates After 66666 Years', 'the-dark-magician-transmigrates-after-66666-years', 'Manhwa', 'Ongoing', 'Diablo Volfir, o mais poderoso mago negro da história, foi selado pelas forças dos deuses durante uma guerra épica. 66.666 anos depois, ele desperta… no corpo de um jovem nobre fraco chamado Jamie Welton.\r\nAgora, com todo o seu poder adormecido e uma nova identidade, Diablo começa a reconstruir sua força mágica enquanto se adapta ao mundo moderno — onde a magia evoluiu, mas a corrupção continua.\r\nA sua missão? Vingança contra os deuses, recuperar a sua glória e descobrir os mistérios que surgiram durante os milénios em que esteve ausente.', 'Hwabong', 'Taru', 2021, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749460084/capas/phpBFE4.jpg'),
(66, 'Demonic Evolution', 'demonic-evolution', 'Manhua', 'Ongoing', 'Num mundo onde demónios e humanos coexistem com dificuldades, o protagonista desperta uma habilidade única de evolução demoníaca após quase ser morto.\r\nDotado da capacidade de devorar e absorver habilidades de outros seres demoníacos, ele começa a subir na cadeia alimentar, tornando-se cada vez mais poderoso e monstruoso a cada batalha.\r\nMas quanto mais ele evolui... menos humano se torna. Será que ele vai conseguir manter a sua humanidade — ou abraçar por completo o seu lado demoníaco?', 'Unknown', 'Unknown', 2022, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749460256/capas/php5D25.jpg'),
(67, 'Omniscient Reader’s Viewpoint', 'omniscient-readers-viewpoint', 'Manhwa', 'Ongoing', 'Durante anos, Kim Dokja foi o único leitor fiel de uma web novel obscura chamada Três Maneiras de Sobreviver ao Apocalipse. Um dia, o mundo começa a desmoronar... exatamente como descrito nessa história.\r\nSem aviso, monstros surgem, regras de um sistema aparecem, e o mundo transforma-se num jogo de sobrevivência governado por \"Constelações\".\r\nAgora, Kim Dokja é a única pessoa que conhece toda a história — mas ele não é o protagonista. Usando o seu conhecimento como leitor, ele terá de manipular eventos, formar alianças e enganar até mesmo os deuses para sobreviver.', 'Sing Shong', 'Sleepy-C (REDICE Studio)', 2020, 'https://res.cloudinary.com/dghfkjx36/image/upload/v1749460406/capas/phpA32E.jpg');
